function setCookie(o){let e=new Date;e.setTime(e.getTime()+108e6);let n=crypto.randomUUID();console.log("uuid: ",n);let t=window.location.hostname;document.cookie="name="+o+"; expires="+e.toUTCString()+"; uid="+n+"; secure; domain="+t+"; path=/",console.log("Cookie: "+o+" is set.")}function getCookie(o){var e=document.cookie.match(new RegExp("(^| )"+o+"=([^;]+)"));e?(console.log("Cookie found!"),console.log(e[2])):(console.log("Cookie: "+o+" was not found. Creating cookie."),setCookie(o))}